INSERT INTO `web_cryptocurrency` (id,name,description,website,twitter) VALUES (1,'bitcoin','Bitcoin is an innovative payment network and a new kind of money. Find all you need to know and get started with Bitcoin on bitcoin.org.','https://bitcoin.org/','https://twitter.com/Bitcoin'),
 (2,'ethereum','Ethereum is a decentralized platform for applications that run exactly as programmed without any chance of fraud, censorship or third-party interference.','https://www.ethereum.org/','https://twitter.com/ethereum'),
 (3,'ripple','Ripple connects banks, payment providers, digital asset exchanges and corporates via RippleNet to provide one frictionless experience to send money globally.','https://ripple.com/','https://twitter.com/Ripple'),
 (4,'bitcoin-cash','Bitcoin Cash brings sound money to the world. Merchants and users are empowered with low fees and reliable confirmations. The future shines brightly with unrestricted growth, global adoption, permissionless innovation, and decentralized development.','https://www.bitcoincash.org/','https://twitter.com/BITCOlNCASH'),
 (5,'eos','The Most Powerful Infrastructure for Decentralized Applications.','https://eos.io/','https://twitter.com/eos_io'),
 (6,'litecoin','Litecoin is a cryptocurrency that enables instant payments to anyone in the world and that can be efficiently mined with consumer-grade hardware.','https://litecoin.com','https://twitter.com/LitecoinProject'),
 (7,'stellar','Stellar is an open platform for building financial products that connect people everywhere.','https://www.stellar.org','https://twitter.com/stellarorg'),
 (8,'iota','The IOTA protocol is a Distributed Ledger Technology developed by the IOTA Foundation. It is a next-generation technology designed from the ground up to be the data and value transfer layer for the Machine Economy.','https://www.iota.org','https://twitter.com/iotatoken'),
 (9,'cardano','Cardano is a decentralised public blockchain and cryptocurrency project and is fully open source. Cardano is developing a smart contract platform which seeks to deliver more advanced features than any protocol previously developed. It is the first blockchain platform to evolve out of a scientific philosophy','https://www.cardano.org','https://twitter.com/cardanocom'),
 (10,'tron','TRON is committed to promoting the decentralization of the Internet and is committed to building infrastructure for the decentralized Internet. Its wavefield TRON protocol is one of the world''s largest blockchain-based decentralized application operating system protocols. It provides high-throughput, high-scalability, and high-reliability underlying public-chain support for decentralized application operations on the protocol.','https://tron.network/','https://twitter.com/Tronfoundation'),
 (11,'neo','NEO is a non-profit community-based blockchain project that utilizes blockchain technology and digital identity to digitize assets, to automate the management of digital assets using smart contracts, and to realize a "smart economy" with a distributed network.','https://neo.org/','https://twitter.com/neo_blockchain'),
 (12,'monero','Home [on the home of Monero, a digital currency that is secure, private, and untraceable]','http://www.monero.cc','https://twitter.com/monero');
